var (
	Wait   = flag.Duration("wait", time.Millisecond*40, "wait delay after rlt tx")
	Esc    = flag.Duration("esc", time.Second*55, "escape monitor delay after rlt tx")
	Net    = flag.Bool("net", false, "network tests")
	Dsk    = flag.Bool("dsk", false, "disk tests")
	ImgDir = flag.String("imgDir", "/tmp/", "image directory")
	ImgOpn = flag.Bool("imgOpn", false, "open test images")

	Cfg    = NewCfg()
	Instrs = NewInstrs(Cfg)
)

func EnsureNet(t *testing.T) {
	if !*Net {
		t.Skip("Net: false")
	}
}
func EnsureDsk(t *testing.T) {
	if !*Dsk {
		t.Skip("Dsk: false")
	}
}

func DrawPlt(p plt.Plt, opn ...bool) {
	filepath := fmt.Sprintf("%v%v.png", *ImgDir, sys.FnName(1))
	p.Bse().PngSav(filepath)
	if len(opn) != 0 || *ImgOpn {
		sys.OpnImg(filepath)
	}
}

func NewCfg() (r *cfg.Cfg) {
	r = &cfg.Cfg{}
	r.Test = true
	// r.Trc = trc.TicrRx | trc.TicrTx | trc.RltInrvl | trc.RltSide | trc.RltStm | trc.RltCnd | trc.RltStgy
	r.BqProject = "pro-cld"
	// oan
	r.Oan.BqDataset = "oan_cor_tic"
	r.Oan.AccountID = "101-001-4093945-001"
	r.Oan.Token = "d3e81b3ca79ebd8cf471e31b7d3a4f74-d5cee5a343849dcbb45e3fd6f21870f0"
	r.Oan.BaseURL = "https://api-fxpractice.oanda.com"
	r.Oan.BaseStreamURL = "https://stream-fxpractice.oanda.com"
	r.Oan.MktHr = tme.H1 * 21
	r.Oan.MktTrdBuf = tme.M1 * 3
	r.Oan.ComPerUnitUsd = 0.00005
	r.Oan.GapFil = true

	// hst
	r.Hst.Rng = tme.NewRng(tme.NewDte(2018, 4, 9), tme.NewDte(2018, 4, 10))
	r.Hst.BalUsd = 10000.0
	r.Hst.TrdPct = 0.5
	// rlt
	r.Rlt.TrdPct = 0.5
	// plt
	r.Plt.InrvlCnt = 6
	return r
}

func NewInstrs(cfg *cfg.Cfg) (instrs map[str.Str]*ana.Instr) {
	instrs = make(map[str.Str]*ana.Instr)
	// Generate variable set of test data
	// Allow various segment cases
	// Expect combination of segments to be tested
	// ---       beginning
	//   -----   middle
	//       --- end
	// --------- full
	j := &jsn.Jsnr{}
	pct100 := unt.Unt(2772) // lines in ticsStr
	fstPct30 := unt.Unt(float64(pct100) * .3)
	lstPct30 := pct100 - fstPct30
	// fmt.Println("fstPct30", fstPct30, "lstPct30", lstPct30)
	rdr := bufio.NewReader(strings.NewReader(ticsStr))
	var lnIdx unt.Unt
	for {
		// ensure the last ln of each stm is a price tic
		// so that rlt behavior matches hst behavior
		// first may be heartbeat or not
		// helps ensure hst/rlt parity in testing
		lnByts, er := rdr.ReadBytes('\n')
		if lnIdx == fstPct30 || lnIdx == lstPct30 {
			j.Reset(string(lnByts))
			isPriceTic := j.Str("type") == "PRICE" && j.Bol("tradeable")
			if lnIdx == fstPct30 && !isPriceTic {
				fstPct30++ // move until price tic hit
			}
			if lnIdx == lstPct30 && !isPriceTic {
				lstPct30++ // move until price tic hit
			}
		}
		if er != nil {
			break
		}
		lnIdx++
	}
	// fmt.Println("fstPct30", fstPct30, "lstPct30", lstPct30)
	bnds := []bnd.Bnd{
		bnd.Bnd{Idx: 0, Lim: fstPct30 + 1},        // beginning (30%)
		bnd.Bnd{Idx: fstPct30, Lim: lstPct30 + 1}, // middle (40%)
		bnd.Bnd{Idx: lstPct30, Lim: pct100},       // end (30%)
		bnd.Bnd{Idx: 0, Lim: pct100},              // full (100%)
	}
	for n, instrName := range ks.InstrNames {
		i := &ana.Instr{}
		i.Name = str.Str(instrName)
		i.Typ = "CURRENCY"
		i.Pip = 0.0001
		i.MrgnRtio = 50.0
		i.DisplayPrecision = 5
		i.TradeUnitsPrecision = 1
		i.MinTrdSize = 1
		i.MaxTrailingStopDistance = 1.00000
		i.MinTrailingStopDistance = 0.00050
		i.MaxPositionSize = 1
		i.MaxOrderUnits = 10000000

		// parse tic lines for hst and rlt
		i.HstStm = ana.NewStm()
		instrNameUpper := strings.ToUpper(instrName)
		rdr := bufio.NewReader(strings.NewReader(ticsStr))
		var lnIdx unt.Unt
		for {
			lnByts, er := rdr.ReadBytes('\n')
			if lnIdx >= bnds[n].Idx && lnIdx < bnds[n].Lim {
				ln := strings.Replace(string(lnByts), "EUR_USD", instrNameUpper, 1)
				j.Reset(ln)
				if j.Str("type") == "PRICE" && j.Bol("tradeable") {
					i.HstStm.OanJsnRed(j) // HstStm has no heartbeats
					if Cfg.Oan.GapFil {   // USE tst.CFG
						i.HstStm.GapFil(true)
					}
				}
			}
			if er != nil {
				break
			}
			lnIdx++
		}
		// i.HstStm.Validate()

		// calculate instr stats
		i.CalcStats() // based on HstStm
		i.CalcMktWeeks(cfg.MktHr)
		sys.Log(i)
		instrs[i.Name] = i
	}
	return instrs
}
func TimeDir(prefix string) string {
	t := time.Now()
	tStr := fmt.Sprintf("%v%v%v_%v%v%v_%v", t.Year(), t.Month(), t.Day(), t.Hour(), t.Minute(), t.Second(), t.Nanosecond())
	return filepath.Join(prefix, tStr)
}

